import { SingleTodo } from "./components/SingleTodo";
import { Todos } from "./components/Todos";
import BackgroundImg from "./bg.jpg";
import "./index.css";

function App() {
  let sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: "url(" + { BackgroundImg } + ")",
    backdropFilter: "blur(5px)",
  };

  return (
    <div
      style={sectionStyle}
      className="h-screen flex flex-col items-center pt-20 bg-cover backdrop-blur backdrop-blur-2xl"
    >
      <h1 className="text-white mb-10 text-4xl">
        Todo Application with React/Redux
      </h1>
      <Todos />
      <SingleTodo />
    </div>
  );
}

export default App;
